import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Layout from './components/Layout';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout>Dashboard Content</Layout>} />
        <Route path="/about" element={<Layout>About Content</Layout>} />
        <Route path="/analytics" element={<Layout>Analytics Content</Layout>} />
        <Route path="/comment" element={<Layout>Comment Content</Layout>} />
        <Route path="/product" element={<Layout>Product Content</Layout>} />
        <Route path="/productList" element={<Layout>Product List Content</Layout>} />
      </Routes>
    </Router>
  );
}

export default App;
